script: |
  super -f text -I q9117.spq | sort > q9117.out

inputs:
  - name: q9117.spq
    data: |
      SELECT ALL - - col0 + col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL NOT IN ( + col2 * col1 + - - 26 + col0, - 71, + 36 / + col2, + col0 - + - col1 * - + col1, + 3 );
  - name: tab2

outputs:
  - name: q9117.out
    data: |
